  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
  },
}));


class AdminApp extends Component
{
    render()
    {
        return(
            <Container maxWidth="sm"></Container>
        )
